              d="M23.4839 22.4808C23.4839 23.8865 24.6104 25.0261 26 25.0261C27.3896 25.0261 28.5161 23.8865 28.5161 22.4808H23.4839ZM28.5161 2.54538C28.5161 1.13962 27.3896 0 26 0C24.6104 0 23.4839 1.13962 23.4839 2.54538H28.5161ZM16.9783 11.5783C18.243 10.9957 18.8013 9.48627 18.2256 8.2069C17.6496 6.92753 16.1575 6.36269 14.8929 6.94528L16.9783 11.5783ZM2.51643 30.2391L0 30.2258L0.000503903 30.2686L2.51643 30.2391ZM26 53.4529L26.0289 50.9075C26.0097 50.9075 25.9903 50.9075 25.9711 50.9075L26 53.4529ZM49.4836 30.2391L52 30.2686L51.9997 30.2258L49.4836 30.2391ZM37.1071 6.94528C35.8423 6.36269 34.3504 6.92753 33.7744 8.2069C33.1987 9.48627 33.757 10.9957 35.0217 11.5783L37.1071 6.94528ZM28.5161 22.4808V2.54538H23.4839V22.4808H28.5161ZM14.8929 6.94528C5.86596 11.1036 0.0519658 20.1916 0 30.2258L5.0325 30.2523C5.0742 22.2037 9.73749 14.9139 16.9783 11.5783L14.8929 6.94528ZM0.000503903 30.2686C0.165895 44.6445 11.8185 56.1632 26.0289 55.9983L25.9711 50.9075C14.5395 51.0405 5.16541 41.774 5.03236 30.2095L0.000503903 30.2686ZM25.9711 55.9983C40.1814 56.1632 51.8349 44.6445 52 30.2686L46.9678 30.2095C46.8346 41.774 37.4607 51.0405 26.0289 50.9075L25.9711 55.9983ZM51.9997 30.2258C51.9477 20.1916 46.1341 11.1036 37.1071 6.94528L35.0217 11.5783C42.2624 14.9139 46.9259 22.2037 46.9675 30.2523L51.9997 30.2258Z"
